import React,{Fragment} from "react";
import CartItems from "./Components/Cart/CartItems";
import Header from "./Components/Layout/Header"
import Meals from "./Components/Meals/Meals";

function App() {
  return (
    <Fragment>
      <Header></Header>
      <Meals />
      <CartItems/>
    </Fragment>
  );
}

export default App;
